import Box from '@mui/material/Box';
import { DataGrid } from '@mui/x-data-grid';
import 'bootstrap/dist/css/bootstrap.min.css';

const columns = [
  { field: 'epic', headerName: 'Epic', width: 190 },
  { field: 'mssID', headerName: 'MSS ID', width: 190 },
  { field: 'storyPoints', headerName: 'Story Points', width: 190 },
];

const rows = [
  { id: 1, epic: 'iDAPs', mssID: 12, storyPoints: 12},
  { id: 2, epic: 'Gates', mssID: 12, storyPoints: 12},
  { id: 3, epic: 'Bloods', mssID: 12, storyPoints: 12},
];


function AwaitingClientTable() {
  return (
    <Box sx={{ height: 400, width: '50%' }}>
      <DataGrid
        rows={rows}
        columns={columns}
        initialState={{
          pagination: {
            paginationModel: {
              pageSize: 5,
            },
          },
        }}
        pageSizeOptions={[5]}
        disableRowSelectionOnClick
      />
    </Box>
  );
}

export default AwaitingClientTable;
